import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';
import Row from './Components/Row.js';
import Col from './Components/Col.js';
import Button from './Components/Button.js';
import Table from './Components/Table.js';
import Map from './Components/Map.js';
import Icon from './Components/Icon.js';
// import Main from './Main.js';
// import PracticeNewPage from './Components/PracticeNewPage.js';
// import {
//   Route,
//   NavLink,
//   HashRouter
// } from "react-router-dom";
class App extends Component{

    render() {

      const hosts = [
  			{
  				firstName: 'Scott',
  				lastName: 'McConnell',
  				street: '1262 Farm Rd',
  				city: 'Berwyn',
  				state: 'Pennsylvania',
  				zip: '19312',
  				email: 'skm44@duke.edu',
  				phone: '6103124662',
  				spaceType: 'Garage',
  				spaceAvailable: '160',
  				createdAt: new Date()
  			},
  			{
  				firstName: 'Josh',
  				lastName: 'France',
  				street: '220 Alexander Ave',
  				city: 'Durham',
  				state: 'North Carolina',
  				zip: '27705',
  				email: 'jrf36@duke.edu',
  				phone: '9802146075',
  				spaceType: 'Shed',
  				spaceAvailable: '100',
  				createdAt: new Date(),
  			},
  			{
  				firstName: 'Samir',
  				lastName: 'Agadi',
  				street: '207 Erwin Rd',
  				city: 'Durham',
  				state: 'North Carolina',
  				zip: '27705',
  				email: 'sa280@duke.edu',
  				phone: '2486335250',
  				spaceType: 'Closet',
  				spaceAvailable: '50',
  				createdAt: new Date(),
  			},
  		];

      const myProps = {
    'className': "navbar-toggler",
    'type': 'button',
    'aria-label':"Toggle navigation",
    'data-toggle':"collapse",
    'data-target':"#navbarSupportedContent",
     'aria-controls':"navbarSupportedContent",
     'aria-expanded':"false"
  };
  const searchButtonLabel=(<span><Icon iconType="navbar-toggler-icon"/></span>);
    return (
      <div className="App">
        <header className="App-header">
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <img className="navbar-brand" src="/OpenSpaceRevised.png" alt="OpenSpaceRevised"></img>
          <Button attr={myProps} label={searchButtonLabel}/>

          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
              <form className="form-inline my-2 my-lg-0">
                <input className="form-control mr-sm-2" type="search" placeholder="Find space near you" aria-label="Find space near you"></input>
                <button className="btn btn-outline-success my-2 my-sm-0" type="submit" id="searchBarButton">Search</button>
              </form>
            </ul>
            <a className="nav-link disabled" href="/BecomeAHost">Become A Host</a>
          </div>
        </nav>
      <Table dataPoints={hosts} colSpacing="col-md-6"/>
      <Map colSpacing = "col-md-6"/>
      </header>
      </div>
    );
  }

}
export default App;
